import React from 'react';
import { NavLink } from 'react-router-dom';

import './Courses.css';

function Courses() {
  return (
    <div className="card-container">
      <div className="card">
        <div className="card-content">
          <p className="card-title">JavaScript</p>
          <NavLink to='/javascript' className="nav-link">JavaScript ES5/ES6</NavLink>
          <NavLink to='/html' className="nav-link">HTML</NavLink>
          <NavLink to='/reactjs' className="nav-link">ReactJS</NavLink>
        </div>
      </div>
    </div>
  );
}

export default Courses;
